INSERT INTO `devices` VALUES (1,'Modem ADSL Wi-Fi','Navigazione veloce e senza fili\n\nCon il Modem ADSL Wi-Fi navighi ad alta velocitÃ  e senza fili, utilizzando l\'interfaccia Wi-Fi o attraverso le 4 porte Ethernet.\n\n    Navigazione piÃ¹ veloce grazie alla tecnologia senza fili Wi-Fi e migliore copertura della rete Wi-Fi della tua abitazione.\n    Protezione: la cifratura WPA e WPA2 impedisce lâ€™accesso ai non autorizzati alla rete Wi-Fi. Disponibili anche funzionalitÃ  avanzate come il filtro degli indirizzi MAC ed il firewall integrato.\n    Tutta la famiglia connessa: collega tutti i PC, smartphone e tablet al nuovo modem ADSL Wi-Fi e inoltre condividi Hard Disk e stampanti collegati alla porta USB del modem.\n    Installazione no problem: il modem si configura automaticamente sulla tua linea ADSL, senza installare software.\n    Risparmia sulla bolletta elettrica: il nuovo modem, rispetto ad un prodotto Telecom Italia di generazione precedente con le stesse funzionalitÃ , consente di risparmiare fino al 40% di energia elettrica su un utilizzo medio annuo.\n\nIl Modem Wi-Fi opera solo su linea ADSL di Telecom Italia ed Ã¨ compatibile con i principali sistemi operativi (Windows 7, Vista, XP - MacOS 10.3).','Tecnologia\n\nADSL/ADSL2+; velocitÃ  fino a 20 Mbps down/1 Mbps up\n\n\nWi-Fi\n\nWi-Fi 802.11 b/g/n; velocitÃ  di trasferimento fino a 300Mbps\n\n\nInterfacce\n\nInterfacce USB alta velocitÃ  (480 Mbit/s) ad alta potenza (500 mA), 1 porta connettore tipo A Interfaccia Wi-FiStandard IEEE 802.11nInterfaccia radio 2.4Ghz, 2 antenne, velocitÃ  di trasmissione teorica 300 Mbps\n\n\nProtezione Wireless\n\nWPA, WPA-PSK, WEP - Supporto Wi-Fi Protected Setup - Controllo di accesso\n\n\nFunzioni avanzate\n\nFunzionalitÃ  di routing avanzate (DHCP server, NAT, NAPT, Virtual Server) - Firewall - Condivisione Hard Disk e Stampante USB\n\n\nAssistenza tecnica\n\n2 anni di garanzia sul prodotto\n\n\nContenuto della confezione\n\nGuida di installazione; CD autoinstallante (compatibile con Windows 7, Vista, XP- MacOS 10.3); 1 filtro ADSL 2+; 1 cavo Telefonico; 1 cavo Ethernet',69,3,'TIM','Embedded','vendita');
